import React, { useEffect, useState } from "react";

const Payment = () => {
  const [user, setUser] = useState({});
  useEffect(() => {
    setUser(JSON.parse(localStorage.getItem("user_details")));
    console.log(user);
  }, []);
  return <div className="payment">

  </div>;
};

export default Payment;
